// ConsoleGame.js
import React from 'react';
import { useParams } from 'react-router-dom';

const ConsoleGame = () => {
    const { id_game } = useParams();

    return (
        <div>
            <h1>Console Game</h1>
            <p>This is a placeholder for the Console Game component.</p>
            <p>Game ID: {id_game}</p>
        </div>
    );
};

export default ConsoleGame;
